import { Injectable } from '@angular/core';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

import { SERVER_API_URL } from 'app/app.constants';
import { createRequestOption } from 'app/shared';
import { INotifiche } from 'app/shared/model/notifiche.model';

type EntityResponseType = HttpResponse<INotifiche>;
type EntityArrayResponseType = HttpResponse<INotifiche[]>;

@Injectable({ providedIn: 'root' })
export class NotificheService {
    public resourceUrl = SERVER_API_URL + 'api/notifiches';

    constructor(private http: HttpClient) {}

    create(notifiche: INotifiche): Observable<EntityResponseType> {
        return this.http.post<INotifiche>(this.resourceUrl, notifiche, { observe: 'response' });
    }

    update(notifiche: INotifiche): Observable<EntityResponseType> {
        return this.http.put<INotifiche>(this.resourceUrl, notifiche, { observe: 'response' });
    }

    find(id: number): Observable<EntityResponseType> {
        return this.http.get<INotifiche>(`${this.resourceUrl}/${id}`, { observe: 'response' });
    }

    query(req?: any): Observable<EntityArrayResponseType> {
        const options = createRequestOption(req);
        return this.http.get<INotifiche[]>(this.resourceUrl, { params: options, observe: 'response' });
    }

    delete(id: number): Observable<HttpResponse<any>> {
        return this.http.delete<any>(`${this.resourceUrl}/${id}`, { observe: 'response' });
    }
}
